  input: "\"TEXT\",\"F3XN\",\"\",\"April 29, 2003/Mr. John D. Gibson/Assistant Staff
    Director/Reports Analysis Division/Federal Election Commission/999 E Street, NW/Washington,
    D.C. 20463/Re:  The Freedom Project 2002 October Monthly Report/Dear Mr. Gibson:/\tI
    am in receipt of your letter dated April 10, 2003 notifying me that the Freedom
    Project had not responded to Antoinette Kitchen's letter of March 19, 2003.  Upon
    receipt of this letter, Ms. Kitchen was notified that The Freedom Project did
    not receive the March 19 letter and would respond by the April 30 deadline set
    in your letter./The March 19 letter indicates that The Freedom Project may have
    made excessive contributions to several candidates and that it must seek a refund
    of the excessive amount of any contribution, or provide a written authorization
    for a redesignation.  The Freedom Project had requested refunds from each of the
    candidates identified in your letter on October 20, 2002.  Copies of those letters
    will be included in hard copy of this letter filed with the Federal Election Commission.
    \ In addition, in response to your letter, The Freedom Project has made a second
    request from each of the candidates involved.  Copies of those letters also will
    be provided as an enclosure to the hard copy of letter.  Finally, as required,
    The Freedom Project will report refunds from each of these candidates during the
    reporting period received./I trust this responds to your letter./Sincerely,/Bruce
    A. Gates\",\"\""
